{"description":"Maximus is an example of a great builder in many hats. He is in a team building a community for Castileo and Onchain HQ.

He has been bullish and active in Lil Pudgy community for very long. His content is fun and we do enjoy wathcing his content. His consisntency is the key why he is good in this.

I believe he is a good example of how a web 3 builder should have fun while making content."}

{"description":"One of us who truly contribute to Abstract ecosystem and a strong believer to the green consumer chain. I didn't personally know Envok but seeing him within the community since October 2024

This level of dedication and consistency toward Abstract is hard to find, and I would strongly support him.

Congrats to your recent platinum tier accomplishment as well!"}

{"description":"If I ever get to refer to something that determines Abschud, It would probably be good cop & bad cop play where on the surface he might looks really aggresive to how he handles stuff and moderates community on Abstract

While I get to know him more from another angle, his real intention is to shape the community into a solid, supportive, and zero-farmer community 

On the other side, he'll be willing to support and lend a hand to us people where we never expect it to be which most of people won't get to notice"}
